import React, {Component} from 'react';
import './ProductItem.css'
import * as Config from '../../constants/Config';

class ProductItem extends Component {

    delete = (product) => {
        if(confirm('Bạn chắc chắn muốn xoá ?')) { //eslint-disable-line
            console.log(product.projectName);
            this.props.delete(product);
        }
    };

    render() {
        let {product} = this.props;
        return (
            <tr>
                <td><img src={`${Config.API_URL}/${product.image}`} alt="Sản Xuất Đồ Gỗ"/></td>
                <td><p>{product.projectName}</p></td>
                <td><p>{product.category}</p></td>
                <td><p>{product.investor}</p></td>
                <td><p>{product.address}</p></td>
                <td><p>{product.area}</p></td>
                <td><p>{product.time}</p></td>
                <td><button className="btn-delete" onClick={this.delete(product)}>Xóa</button></td>
            </tr>
        );
    }
}

export default ProductItem;
